	menuObj.customItems[4].enabled = false;
	} else if (_root._quality == "HIGH") {
	menuObj.customItems[5].enabled = false;
	} else if (_root._quality == "BEST") {
	menuObj.customItems[6].enabled = false;
	}*/
	//} else {         
	//menuObj.customItems[0].enabled = true;
	//}
}
