function ContextMuteBGMusic(obj, item) {
	//trace(_root.AutoQuality)
	_root.MuteBGMusic = !_root.MuteBGMusic;
	if (_root.MuteBGMusic == true) {
		_root.StopBGsong();
	} else {
		_root.PlayMusicAndIntro();
	}
}
