_root.CompactNumbers = function(array2) {
	array = [];
	for (var h = 0; h<array2.length; h++) {
		for (var j = 0; j<array2[h].length; j++) {
			//code += array[h][i];
			array.push(array2[h][j]);
		}
	}
	var inarow:Number = 0;
	var lastnum = String(array[0]);
	var st:String = "";
	for (i=0; i<array.length; i++) {
		if (array[i] !== "100") {
			char1 = Math.floor(array[i]/75);
			char2 = array[i]-(char1*75);
			if (String(array[i]) !== String(array[i+1])) {
				st += String.fromCharCode(char1+49)+String.fromCharCode(char2+49);
				if (inarow>0) {
					st += "*"+(inarow+1)+"*";
				}
				inarow = 0;
			} else {
				inarow++;
			}
		} else {
			if (String(array[i]) !== String(array[i+1])) {
				st += "0";
				if (inarow>0) {
					st += "*"+(inarow+1)+"*";
				}
				inarow = 0;
			} else {
				inarow++;
			}
		}
		lastnum = String(array[i]);
	}
	if (inarow>1) {
		//trace("----------------------"+inarow+"----------------------------")
		if (lastnum !== "100") {
			char1 = Math.floor(lastnum/75);
			char2 = lastnum-(char1*75);
			st += String.fromCharCode(char1+49)+String.fromCharCode(char2+49)+"*"+inarow+"*";
		} else {
			st += "0"+"*"+inarow+"*";
		}
	}
	return st;
};
_root.ExpandNumbers = function(st) {
	var array:Array = [];
	array[0] = [];
	h = 0;
	j = 0;
	for (i=0; i<st.length; i += 2) {
		if (st.charAt(i) == "0") {
			i -= 1;
			array[h].push("100");
			if (st.charAt(i+2) == "*") {
				z = i+3;
				numstring = "";
				while (st.charAt(z) !== "*") {
					numstring += String(st.charAt(z));
					z++;
				}
				for (z=0; z<Number(numstring)-1; z++) {
					if (array[h].length>=_root.GridYSize) {
						h++;
						array.push([]);
					}
					array[h].push("100");
				}
				i += 2+numstring.length;
			}
			//                                                                                                                             
		} else {
			array[h].push(((st.charCodeAt(i)-49)*75)+(st.charCodeAt(i+1)-49));
			if (st.charAt(i+2) == "*") {
				z = i+3;
				numstring = "";
				while (st.charAt(z) !== "*") {
					numstring += String(st.charAt(z));
					z++;
				}
				for (z=0; z<Number(numstring)-1; z++) {
					if (array[h].length>=_root.GridYSize) {
						h++;
						array.push([]);
					}
					array[h].push(((st.charCodeAt(i)-49)*75)+(st.charCodeAt(i+1)-49));
				}
				i += 2+numstring.length;
			}
		}
		if (array[h].length>=_root.GridYSize) {
			h++;
			array.push([]);
		}
	}
	return array;
};
_root.GetCode = function() {
	time = getTimer();
	//code = String(_root.TileArray).split(',');
	//var code:String = "";
	//var array:Array = _root.TileArray;
	//for (var h in array) {
	//for (var i in array[h]) {
	//code += array[h][i];
	//}
	//}
	code = String(_root.GridXSize)+"x"+String(_root.GridYSize);
	// ^ Stats like size and name an bg
	code += "~"+_root.CompactNumbers(_root.TileArray);
	// ^ Tile arry compacted
	code += "~";
	for (i=0; i<_root.LDItemArray.length; i++) {
		if (i !== 0) {
			code += "|";
		}
		code += ""+_root.LDItemArray[i];
	}
	code += "~"+_root.LDMusic;
	code += "~"+_root.LDCourseBG;
	code += "~"+escape(_root.LDCourseName);
	// ^ Item Array
	trace("Timed: "+(getTimer()-time)+" ms");
	return (code);
};
