//#include "Mario Custom Math Functions.as"
radiansToAngle = function (a) {
	a = 180/Math.PI*a;
	return a;
};
angleToRadians = function (a) {
	a = a/180*Math.PI;
	return a;
};
groundFriction = function (a, b, c) {
	// a is the current speed
	// b is the subtraction speed
	// c is the division speed
	// d is if it's positive or negative (automaticly determined)
	if (a>0) {
		d = 1;
	} else {
		d = -1;
	}
	a = Math.abs(a);
	a -= b;
	if (a<0) {
		a = 0;
	}
	a /= c;
	a *= d;
	return a;
};
moveObject = function (a, b, c) {
	// a the X direction
	// b is the Y direction
	// C is who it moves
	c._x += a;
	c._y += b;
};
moveObjectFromAngle = function (a, b, c) {
	// a is the distance
	// b is the angle
	// c is who
	c._x += Math.cos(angleToRadians(b))*a;
	c._y += Math.sin(angleToRadians(b))*a;
};
moveObjectFromRadians = function (a, b, c) {
	// a is the distance
	// b is the radians
	// c is who
	c._x += Math.cos(b)*a;
	c._y += Math.sin(b)*a;
};
shuffleArray = function (a:Array, b:Number) {
	// a is the array to shuffle
	// b is how much it suffles it
	d = a.push();
	for (i=0; i<b; i++) {
		e = random(d);
		f = random(d);
		if (e !== f) {
			g = a[e];
			a[e] = a[f];
			a[f] = g;
		}
	}
	return (a);
};
